//github.com/reuters-graphics/style/tree/master/packages/stylelint-config), which extends [stylelint-config-standard](https://github.com/stylelint/stylelint-config-standard).\n\n\n```bash\nyarn add -D @reuters-graphics/stylelint-config stylelint\n```\n\nAdd an `.stylelintrc.json` to the root of your project with the following:\n\n```javascript\n{\n  "extends": "@reuters-graphics/stylelint-config"\n}\n```\n\nCheck out the [integrations available](https://stylelint.io/user-guide/integrations/editor) for your editor.\n',e.context||{})},e),null)}},function(e,t,n){e.exports={component:"_3jAiy-v-hTLgTnJRSf1-zz"}},function(e,t,n){"use strict";function o(t,e){var n,r=Object.keys(t);return Object.getOwnPropertySymbols&&(n=Object.getOwnPropertySymbols(t),e&&(n=n.filter(function(e){return Object.getOwnPropertyDescriptor(t,e).enumerable})),r.push.apply(r,n)),r}function r(r){for(var e=1;e<arguments.length;e++){var a=null!=arguments[e]?arguments[e]:{};e%2?o(Object(a),!0).forEach(function(e){var t,n;t=r,e=a[n=e],n in t?Object.defineProperty(t,n,{value:e,enumerable:!0,configurable:!0,writable:!0}):t[n]=e}):Object.getOwnPropertyDescriptors?Object.defineProperties(r,Object.getOwnPropertyDescriptors(a)):o(Object(a)).forEach(function(e){Object.defineProperty(r,e,Object.getOwnPropertyDescriptor(a,e))})}return r}var a=n(0),i=n(13),l=n(15);e.exports=function(e){return a.createElement(i,r({source:l.render("### The script\nWe've reworked our ai2html script a bit. Now it will/can:\n-  Automatically generate the media queries depending on the number of artboards you use. You can use upto 5:\n    - xs: < 575px\n    - sm: 575px to 765px\n    - md: 765px to 992px\n    - lg: 992px to 1300px\n    - xl: 1300px and beyond\n-  Works with every font style we load in our projects. (source, menlo, knowledge)\n-  It generates divs with background images instead of img tags.\n-  It spits out .ejs files instead of .html files.\n\n* * * * * *\n➽ Get the ai2html script [here](https://github.com/reuters-graphics/ai2html/blob/master/ai2html.js) \n\n➽ Get the ai2html graphics template [here](https://github.com/reuters-graphics/bluprint_graphics-rig/blob/master/project-files/ai2html-template.ait).\n* * * * * *\n\n### The template\nThe default template has four artboards since that seems to be the most common number people use. You can add a fifth larger one/remove as you please. \n**Caveat** being you can't remove from the smallest up but only from the largest down. So you *can't* remove xs and keep sm, md and lg. But you *can* remove lg and md, and keep xs and sm.\n\nThe Illustrator template is included with the project-files folder everytime you create a new graphics project with the rig.\n\n### How to use it\n1) Make sure you have the ai2html script installed (linked above).\n\nTo install, save the **ai2html_newrig.js** file in the Scripts folder for Adobe Illustrator. The path will be something like...\n\n> - Applications/\n>   - Adobe Illustrator 2020/\n>   - Presets/\n>   - en_US/\n>   - Scipts/\n>   - ai2html.js\n\nNOTE: You’ll need to close and reopen Illustrator in order for it to show up in Illustrator’s dropdown menu.\n\n2) Build your graphic element in Illustrator and customize the layout across each artboard. You can find the Illustrator web template in the **project-files/** directory of the [Bluprint graphics rig](https://github.com/reuters-graphics/bluprint_graphics-rig) (It’s also linked above).\n\nUse the \"Base Styles\" toolbox as a reference point for typography and style elements like arrow types, axis lines and labels. _Hint: The eye dropper tool is your friend here._\n\n3) When you’re ready to place your artwork, run the ai2hml script from Illustrator `File > Scripts > ai2html`.\n\nThis will write your files to a local filepath to be included in your ejs files. The filepath will be **...src/html/your-project-name.ejs**. The background images for the graphic will be saved to the **.../src/static/img/** directory and will automatically work when you place the graphic in the page.\n\n### To place the graphic on your page\nSimply include the .ejs file in your working markup. For example, if your main article markup is in the article.ejs file, you might include your graphic like so:\n\n```\n<section class='graphic'>\n    <%- include('your-project-name.ejs'); %>\n</section>\n```\n\n### Fluid vs. Fixed\nBy default, your ai2html graphic will snap to **fixed** sizes according to the size of the parent container. This is great for the consistent label positioning and sizing, but it can lead to undesirably large margins in some contexts.\n\nIf you would like your graphic to be fluid (responsive to the width of the parent container without snapping to pre-set sizes) you need to do two things: 1) Set the ai2html setting **responsiveness: fluid** in the Illustrator document. 2) add the **.fluid** class to the section tag holding the graphic. Ex:\n\n```\n<section class='graphic fluid'>\n    <%- include('your-project-name.ejs'); %>\n</section>\n```\n\n\n",e.context||{})},e),null)}},function(e,t,n){"use strict";function o(t,e){var n,r=Object.keys(t);return Object.getOwnPropertySymbols&&(n=Object.getOwnPropertySymbols(t),e&&(n=n.filter(function(e){return Object.getOwnPropertyDescriptor(t,e).enumerable})),r.push.apply(r,n)),r}function r(r){for(var e=1;e<arguments.length;e++){var a=null!=arguments[e]?arguments[e]:{};e%2?o(Object(a),!0).forEach(function(e){var t,n;t=r,e=a[n=e],n in t?Object.defineProperty(t,n,{value:e,enumerable:!0,configurable:!0,writable:!0}):t[n]=e}):Object.getOwnPropertyDescriptors?Object.defineProperties(r,Object.getOwnPropertyDescriptors(a)):o(Object(a)).forEach(function(e){Object.defineProperty(r,e,Object.getOwnPropertyDescriptor(a,e))})}return r}var a=n(0),i=n(13),l=n(15);e.exports=function(e){return a.createElement(i,r({source:l.render('## Adding charter styles\n\nYou will need to import the charter styles into main.scss.\n\n```scss\n@import \'~ReutersCharter/sass/chartstyles\';\n```\n\n## Import charter into your JS\n\nYou will need to import the the charter into main.js.\n\n```js\nimport ReutersCharter from \'ReutersCharter\';\n```\n\nSome settings in the charter block rely on d3 date conventions, so if you have not already imported d3 you may need to import a few modules, depending on your settings. \n\n\n```js\nlet formatter = require(\'d3-format\');\nlet d3 = Object.assign(\n  formatter,\n  require(\'d3-fetch\'),\n  require(\'d3-time-format\')\n);\n```\n\n\n## Charter block.\n\nI plan to circle back and actually document ALL OF THESE OPTIONS. For now, here is the whole shibazz. \n\n```js\nlet stockChart = new ReutersCharter.BarChart({\n\tel: "#reutersGraphic-chart1",\n\thasPym: isEmbedded,\n\t\n\t////////////////////////////\n\t///// DATA PROCESSING //////\n\t////////////////////////////\n\t\n\tdataURL: \'//d3sl9l9bcxfb5q.cloudfront.net/json/mw-disney-earns\',\n\t//dataTransformation:"none", //none, changePrePeriod, cumulativeTotal, cumulativeChange, percentChange\n\t//divisor:.001,\t\n\t//multiDataColumns:{"gpd":"GDP","unemployment":"Unemployment"}, //can set as an object, or as two arrays below.\n\t//multiDataColumns:["gpd","unemployment"],//can use value, changePrePeriod, cumulativeTotal, cumulativeChange, percentChange\n\t//multiDataLabels:[gettext("VALUE"),gettext("PERCENT")],\n\t//xValue:\'days\', //for scatter plots, or two linear scales of line charts.\n\t//yValue:\'otherThing\',\n\t//xValueSort:"none", //will not sort bespoke xValues\n\n\t///////////////////////////////////\n\t///// COLOR AND WHAT TO PLOT //////\n\t///////////////////////////////////\n\n\t//columnNames:{google:gettext("Google"), apple:gettext("Apple")}, // undefined uses sheet headers, object will map, array matches columnNamesDisplay\n\t//colors: [blue3, purple3,orange3, red3,yellow3],  //array or mapped object\n\t//columnNamesDisplay:[gettext("Bob"),gettext("Jerry")], // only use this if you are using an array for columnNames\n\n\t///////////////////////////////////\n\t///// CHART DIMENSIONS       //////\n\t///////////////////////////////////\n\n\t//margin:{top:100},\n\theight:220, //if < 10 - ratio , if over 10 - hard height.  undefined - square\n\n\t///////////////////////////////////\n\t///// AXIS AND TICKS         //////\n\t///////////////////////////////////\n\t\n\t//YTickLabel: [[gettext("$"),gettext("cows")]], //     - use that code for a space.\n\t//xScaleTicks: 5,\n\t//yScaleTicks:5,\n\t//yScaleVals: [0,100],\n\t//xScaleVals: [parseDate("1/1/16"),parseDate("6/1/16"),parseDate("1/1/17")],\n\t//yScaleMin(){return 0}, // can overwrite yScaleMax, yScaleMin, xScaleMax, xScaleMin\t\t\t\n\t//yorient:"Right",\n\t//xorient:"Top",\n\t//yTickFormat (d,i,nodes) {\n\t//\treturn d\n    //},    \n\t//xTickFormat  (d,i,nodes)  {\n\t//\treturn d\n    //},\n    //scaleNumbFormat:true, //activating will force tick values to be formatted by number formatter.\t\n    //includeXAxis:false,\n    //includeYAxis:false,\t\n\t//xAxisLineLength:"short", //long or short or none. long will go all the way across, but not under the tick numbers\n\t//yAxisLineLength:"short",\t\t\t\t\n\n\n\t///////////////////////////////////\n\t///// SORTING                //////\n\t///////////////////////////////////\n\t\n\t//categorySort:"none", //ascending, descending, alphabetical, none, array\n\t//groupSort:"descending", //ascending, descending,  none, array IF NONE: will match order of column names above. if those undefined, will be order in data.\n\n\t///////////////////////////////////\n\t///// DATE PARSE AND FORMAT  //////\n\t///////////////////////////////////\n\n\t//dateFormat:d3.timeFormat("%b %Y"),\n\t//dateParse:d3.timeParse("%d/%m/%y"),\n\t//quarterFormat:true,\t\t\t\t\t\n\n\t///////////////////////////////////\n\t///// CHARTING OPTIONS       //////\n\t///////////////////////////////////\n\n\t//colorUpDown:true,\n\t//colorByCat:true,\t\n\t//hashAfterDate:"01/01/2016",\n\t//markDataPoints:true,\n\t//lineType: "linear",//Step, StepAfter, StepBefore\n\t//hasRecessions: true,\t\n\t\n\t///////////////////////////////////\n\t///// LEGEND                 //////\n\t///////////////////////////////////\n\t\n\t//hasLegend: false,\n\t//topLegend:true,\n\t//chartBreakPoint:500, //when do you want the legend to go up top\n\t//navSpacer:true,\n\n\t///////////////////////////////////\n\t///// LAYOUT                 //////\n\t///////////////////////////////////\n\t\n\t//horizontal:true,\n\t//chartLayout:"sideBySide", // basic,stackTotal, stackPercent, fillLines, sideBySide, onTopOf, outlineBar\n\t//chartLayoutLabels:["basic", "sideBySide"], //define this, and buttons appear\n\t//animateOnScroll:true,\n\n\t///////////////////////////////////\n\t///// TOOLTIP                //////\n\t///////////////////////////////////\n\n\t//showTip:"off",\t//tip will come on if no legend.  tip will come on if showTip:true. Tip will not come on at all if showTip:"off"\n\t//showZeros:true, //tooltip will not skip over zero values\n\t//tipNumbFormat (d)  {\t\t\n\t//\tif (isNaN(d) === true){return "N/A";}else{\n\t//\t\treturn this.dataLabels[0] + this.numbFormat(d) + " " + this.dataLabels[1] ;\t\t\t\t\n\t//\t}\t\t\t\t\n\t//},\n\t//numbFormat: d3.format(",.2f"),\n\n\t///////////////////////////////////\n\t///// TEMPLATES              //////\n\t///////////////////////////////////\n\n\t//tipTemplate:tooltip,\n\t//chartTemplate:chartTemplate,\n\t//legendTemplate:legendTemplate,\n\t//timelineTemplate:tooltipTimeline,\t\n\n\t///////////////////////////////////\n\t///// DATASTREAM             //////\n\t///////////////////////////////////\n\n\t//dataStreamOpts:{\n\t//\tdataSeries:3,\n\t//\tlookup:{\n\t//\t\t"PCHV#(GOLDUSD,YTD)":gettext("Gold"),\n\t//\t\t"(1/(JAPAYE$))":gettext("another thing")\n\t//\t}\t\t\t\t\t\n\t//}\n\t\n\t/////////////////////////\n\t///// POLLING     //////\n\t////////////////////////\n\t//IF HORIZONTAL BAR, REQUIRES YOU SET COLUMN NAME AND COLOR AS OBJECT\n\t//isPoll:true,\n\t//moeColumn:"ci",\n\t//leftBarCol:"contact",\n\t//rightBarCol:"leaks",\n\t//centerCol:"dk",\n\t\n\t//annotationNotePadding:15,\n\t//annotationDebug:false,\n\t//annotations:annotations,\n\n\t/////////////////////////\n\t///// scatter     //////\n\t////////////////////////\n\t//idField:"id",\n\t//colorValue:"colors",\n\t//rValue:{\n\t\t//data:"columnName", // a column in your data OR an integer\n\t\t//multiplier:0.6 // an integer\n\t//},\n\t//xValue:\'google\', \n\t//yValue:\'apple\',\n\t//simpleTips:true,\n\t//scaleLabels:{\n\t//\tx:"Inflation",\n\t//\ty:"Unemployment"\n\t//}\n\t// how you want these field displayed, "none" turns them off, can also turn off date:"none",category:"none",colorValue:"none"\n\t//tipValuesDisplay:{rValue:"GDP",xValue:"Range",yValue:"Price"}, \n\t//hasLegend:"off", //legend will appear if you have a color value, you can force it off if you so desire.\n\n})\n\n```\n\n## Charter listeners.\n\nYou can add bespoke code after flagged events in a chart. I will document this further, promise. \n\n\n```js\nstockChart.on("chart:rendered", ()=>{\n\tlet self = stockChart\n\tself.svg.append("line")\n\t\t.attrs({\n\t\t\tx1:0,\n\t\t\tx2:self.width,\n\t\t\ty1:0,\n\t\t\ty2:self.height\n\t\t})\n})\n```\n\n\n## Parsing Datastream data.\n\nRedundant at this point, but i\'ll document this.\n\n```js\nd3.json("//graphics.reuters.com/COMMODITIES-METALS/0100317Z2RY/assetperformance.json").then( (data) => {\n\t\t\n\tlet commodData = new ReutersCharter.DataStreamParse({data:data})\n\tconsole.log(commodData);\n\n\tconst dataStreamData = new ReutersCharter.DataStreamParse({\n\t\tdata:data,\n\t\tdataSeries:3,\n\t\tlookup:{\n\t\t\t"PCHV#(GOLDUSD,YTD)":gettext("Gold"),\n\t\t\t"(1/(JAPAYE$))":gettext("another thing")\n\t\t}\n\t})\n\t\n\tconsole.log(dataStreamData)\n\n})\n```\n',e.context||{})},e),null)}},function(e,t,n){"use strict";function o(t,e){var n,r=Object.keys(t);return Object.getOwnPropertySymbols&&(n=Object.getOwnPropertySymbols(t),e&&(n=n.filter(function(e){return Object.getOwnPropertyDescriptor(t,e).enumerable})),r.push.apply(r,n)),r}function r(r){for(var e=1;e<arguments.length;e++){var a=null!=arguments[e]?arguments[e]:{};e%2?o(Object(a),!0).forEach(function(e){var t,n;t=r,e=a[n=e],n in t?Object.defineProperty(t,n,{value:e,enumerable:!0,configurable:!0,writable:!0}):t[n]=e}):Object.getOwnPropertyDescriptors?Object.defineProperties(r,Object.getOwnPropertyDescriptors(a)):o(Object(a)).forEach(function(e){Object.defineProperty(r,e,Object.getOwnPropertyDescriptor(a,e))})}return r}var a=n(0),i=n(13),l=n(15);e.exports=function(e){return a.createElement(i,r({source:l.render("Write your code in the `src/` directory.\n\n> - src/\n>    - **html/**\n>    - **js/**\n>    - **scss/**\n>    - static/\n\n- `html/`: [EJS templates](https://ejs.co/#docs)\n- `js/`: JavaScript files\n- `scss/`: [SCSS files](https://sass-lang.com/guide#topic-2)\n- `static/`: Static files like images, fonts or other media. See [Working with media files](../working-with-media-files/).\n\n## Contents\n\n- [HTML/EJS](#HTMLEJS)\n  - [Includes](#Includes)\n  - [Templates with data](#Templates-with-data)\n  - [Requiring data](#Requiring-data)\n  - [Special context](#Special-context)\n    - [journalize](#journalize)\n    - [localeMarkdown](#localeMarkdown)\n    - [localeData](#localeData)\n    - [metadata](#metadata)\n    - [lang](#lang)\n    - [gt.gettext](#gtgettext)\n    - [parseMarkdown](#parseMarkdown)\n- [JS vs. HTML/EJS](#JS-vs-HTMLEJS)\n- [JS](#JS)\n  - [Modern syntax and modules](#Modern-syntax-and-modules)\n  - [EJS templates in JS](#EJS-templates-in-JS)\n  - [Translation with ttag](#Translation-with-ttag)\n  - [Translation with markdown](#Translation-with-markdown)\n  - [React](#React)\n  - [Svelte](#Svelte)\n- [SCSS](#SCSS)\n  - [SCSS modules](#SCSS-modules)\n\n## HTML/EJS\n\nHTML is written in [EJS](https://ejs.co/), embedded JavaScript templates.\n\nEJS syntax allows you to use JavaScript to compose your HTML in powerful ways that will make your code much easier to write and read.\n\nTake a look at the official [syntax guide](https://github.com/mde/ejs/blob/master/docs/syntax.md) for complete details on how to use it, but we'll hit the best highlights below along with some special tools added to EJS in our rig.\n\n### Includes\n\nIncludes help you separate and organize your code so it's easier to work with. Here's how they work:\n\n> - html/\n>    - index.ejs\n>    - nav.ejs\n>    - body.ejs\n\n```ejs\n::[4,5]\n\x3c!-- index.ejs --\x3e\n<html>\n  <body>\n    <%- include('nav.ejs'); %>\n    <%- include('body.ejs'); %>\n    <footer>Copyright 2020</footer>\n  </body>\n</html>\n```\n\n```ejs\n\x3c!-- nav.ejs --\x3e\n<nav>\n  <a href=\"/\">Home</a>\n</nav>\n```\n\n```html\n\x3c!-- body.ejs --\x3e\n<h1>Hello world!</h1>\n```\n\n... which would render together like this:\n\n```html\n<html>\n  <body>\n    <nav>\n      <a href=\"/\">Home</a>\n    </nav>\n    <h1>Hello world!</h1>\n    <footer>Copyright 2020</footer>\n  </body>\n</html>\n```\n\n### Templates with data\n\nYou can also pass context data to included files, which make them powerful templates. For example, say we have a list of people we want to display.\n\n> - html/\n>    - index.ejs\n>    - templates/\n>      - person.ejs\n\n```ejs\n\x3c!-- index.ejs --\x3e\n<ul>\n  <% people.forEach(function(person){ %>\n    <%- include('templates/person.ejs', { person: person }); %>\n  <% }); %>\n</ul>\n```\n\n```ejs\n\x3c!-- person.ejs --\x3e\n<li><%= person.firstName %> <%= person.lastName %></li>\n```\n\nSo if our data looked like this...\n\n```javascript\nconst people = [\n  { firstName: 'George', lastName: 'Washington' },\n  { firstName: 'John', lastName: 'Adams' },\n  { firstName: 'Thomas', lastName: 'Jefferson' },\n];\n```\n\n... then our templates would render like this:\n\n```html\n<ul>\n  <li>George Washington</li>\n  <li>John Adams</li>\n  <li>Thomas Jefferson</li>\n</ul>\n```\n\n### Requiring data\n\nSo you can see how powerful templates can be when combined with data, but where does that data come from? Add a data directory to the last example with our data file of dead presidents.\n\n> - html/\n>    - index.ejs\n>    - **data/**\n>      - **presidents.json**\n>    - templates/\n>      - person.ejs\n\n```ejs\n::[2]\n\x3c!-- index.ejs --\x3e\n<% const deadPresidents = require('./data/presidents.json'); %>\n<ul>\n  <% deadPresidents.forEach(function(person){ %>\n    <%- include('templates/person.ejs', { person: person }); %>\n  <% }); %>\n</ul>\n```\n\nJust use the `require` syntax to import JSON data to a normal JS variable, then use that variable to include your templates.\n\n### Special context\n\nThere are a few special context variables that are always included in your templates to do things or to give you access to important data.\n\n#### `journalize`\n\nWe include [journalize](https://github.com/rdmurphy/journalize#readme), which has several extremely useful functions for parsing data into AP-approved text. Check out the [API docs](https://github.com/rdmurphy/journalize#api-docs) for a full explanation of what all it does. Here's an example formatting a date to AP style:\n\n```ejs\n<% const today = new Date(); %>\n<p>Current as of <%= journalize.apdate(today) %>.</p>\n```\n\n#### `localeMarkdown`\n\nThe `localeMarkdown` function allows you to access a locale-specific translations of content written in markdown, the HTML shortcut syntax.\n\nPass the path to file in your locale directory.\n\n> - locales/\n>   - en/\n>     - article/\n>       - **text.md**\n\n```ejs\n::[3]\n\x3c!-- index.ejs --\x3e\n<body>\n  <%- localeMarkdown('article/text.md') %>\n</body>\n```\n\nIf you're using our markdown chunk syntax:\n\n```ejs\n::[3]\n\x3c!-- index.ejs --\x3e\n<body>\n  <%- localeMarkdown('text.md').intro %>\n</body>\n```\n\nYou can also pass data to `localeMarkdown` and use it to fill in text in your markdown files. Pass an object as the second parameter with your context data...\n\n```ejs\n::[3]\n\x3c!-- index.ejs --\x3e\n<body>\n  <%- localeMarkdown('article/text.md', { name: 'Jon' }) %>\n</body>\n```\n\n... then use that data in your markdown files using mustache syntax: Hi, my name is **&#123;&#123; name }}**!\n\n\nRead more about using markdown files for translation on the [Copy and translation](../copy-and-translation/) page.\n\n#### `localeData`\n\n`localeData` follows the same idea as `localeMarkdown` but is for importing JSON data.\n\nSay you have some data that is translated for each locale:\n\n> - locales/\n>   - en/\n>     - **data.json**\n>   - es/\n>     - **data.json**\n> - src\n>   - html/\n>     - index.ejs\n\nIn your templates, you can use `localeData` to include the correct translation of that data in your page.\n\n```ejs\n::[3]\n\x3c!-- index.ejs --\x3e\n<body>\n  <% const data = localeData('data.json') %>\n  <h1><%= data.title %></h1>\n</body>\n```\n\nSo if your markdown files looked like this:\n\n```javascript\n// locales/en/data.json\n{\n  \"title\": \"My English article\"\n}\n```\n\n```javascript\n// locales/es/data.json\n{\n  \"title\": \"Mi articulo en español\"\n}\n```\n\n... they would render to pages like this:\n\n```html\n<body>\n  <h1>My English article</h1>\n</body>\n```\n\n```html\n<body>\n  <h1>Mi articulo en español</h1>\n</body>\n```\n\nRead more about translation on the [Copy and translation](../copy-and-translation/) page.\n\n#### `metadata`\n\nThe `metadata` variable includes metadata about your page, including authors, publish and update times, share and SEO titles, and more.\n\n```ejs\n<p>Published at\n  <time datetime=\"<%- new Date(metadata.publishDate).toISOString() %>\">\n    <%= journalize.apdate(new Date(metadata.publishDate)); %>\n  </time>\n</p>\n\n```\n\n#### `lang`\n\nThis is a variable that represents the current locale. In development, this is always `en`, but when building out separate pages for each translation, it will represent whatever locale is being built, for example `es` for the Spanish page, `de` for German, etc.\n\n```ejs\n<html lang=\"<%= lang %>\" dir=\"ltr\">\n  <body></body>\n</html>\n```\n\n#### `gt.gettext`\n\n`gt.gettext` is a special function that will extract and get locale-specific translations of text from `.gettext.po` files.\n\n```ejs\n<p>\n  <%= gt.gettext('Hello world!') %>\n</p>\n```\n\nRunning the `extractText` command will create a `messages.gettext.po` file in each locale folder like this:\n\n```\nmsgid \"\"\nmsgstr \"Content-Type: text/plain; charset=utf-8\n\"\n\n#: src/html/index.ejs:2\nmsgid \"Hello world!\"\nmsgstr \"\"\n```\n\n... so if your `locales/es/messages.gettext.po` is like this ...\n\n```\nmsgid \"\"\nmsgstr \"Content-Type: text/plain; charset=utf-8\n\"\n\n#: src/html/index.ejs:2\nmsgid \"Hello world!\"\nmsgstr \"¡Hola Mundo!\"\n```\n\n... your template will render to a Spanish page like this:\n\n```html\n<p>\n  ¡Hola Mundo!\n</p>\n```\n\n\nRead more about translation on the [Copy and translation](../copy-and-translation/) page.\n\n#### `parseMarkdown`\n\nYou can also parse [Markdown](https://guides.github.com/features/mastering-markdown/)-formatted strings in your templates:\n\n```ejs\n<% const myMarkdown = '### Header\\n\\nThis is a paragraph'; %>\n\n<%- parseMarkdown(myMarkdown); %>\n```\n\n... which will create HTML like ...\n\n```html\n<h3>Header</h3>\n<p>This is a paragraph</p>\n```\n\nYou can also pass additional data to the parser, which you can use to fill in variables in your text using [mustache](https://github.com/janl/mustache.js#variables)-style placeholders like this...\n\n```ejs\n::[3,5]\n<% const someNumber = 2; %>\n\n{{={{{ }}}=}}\n<% const myMarkdown = '### Header\\n\\nThe count is {{ count }}.'; %>\n{{{={{ }}=}}}\n\n<%- parseMarkdown(myMarkdown, { count: someNumber }); %>\n```\n\n... which will create HTML like ...\n\n```html\n<h3>Header</h3>\n<p>The count is 2.</p>\n```\n\n\n## JS vs. HTML/EJS\n\nBefore we move on to JavaScript, it's worth mentioning why you _might_ want to prefer writing most of your page content in EJS templates.\n\nYou might be wondering, if EJS is just \"embedded JavaScript,\" why wouldn't I just write all my content *in JavaScript?*\n\nThe main reason has to do with _how_ and _when_ content is rendered.\n\n### Static vs. dynamic\n\nWhen you write your content in JavaScript, that content isn't immediately available on the page readers go to.\n\nSay you have a page like this:\n\n```html\n<body>\n  <div id='my-content'></div>\n  <script src='script.js'><\/script>\n</body>\n```\n\nAnd a script that injects content onto that page like this:\n\n```javascript\n// script.js\nconst page = { title: 'Hello world!' };\n\ndocument.getElementById('my-content').innerHTML = '<h1>' + page.title + '</h1>';\n```\n\nWhen a user comes to that page, the first thing that renders is a page with an empty `div#my-content`, _then_ the page requests your script, your script runs and finally your content appears.\n\nFor a normal reader with a reasonably fast internet connection, that delay may be imperceptible (though not always!). But in one case, that delay is critical:\n\nEnter BOTS.\n\nWhen Google's bots scrape your page to index it in search results, it may not wait for your script to run. So what Google sees is an empty page and will rank your page accordingly.\n\nThat's the downside of rendering content in the browser via JavaScript.\n\nWhen you use EJS templates, though, your content is <strong>pre-</strong>rendered when we build the page. So with a simple template like this:\n\n```ejs\n<body>\n  <% const page = localeData('pageData.json') %>\n  <div id-'my-content'>\n    <h1><%= page.title %></h1>\n  </div>\n</body>\n```\n\n... your page is rendered to this when we build it ...\n\n```html\n<body>\n  <div id-'my-content'>\n    <h1>Hello world!</h1>\n  </div>\n</body>\n```\n\nReaders and bots alike will see your content immediately without waiting for the round-trip to get and execute a script.\n\nThat's the benefit of **pre-rendering static content** when we build your page.\n\nThere is, however, a case where you may need to render your content on the client: when that content needs to change, or is **dynamic**.\n\nLet's say you're fetching some data from an API that you want to use on your page.\n\nIf you were to write that in EJS like this:\n\n```ejs\n<p>Today's temperature is <%= apiData.temp %> degrees.</p>\n```\n\nThen when we pre-render it, your page will show whatever the temperature was at the moment you built your page. Not great for readers who visit the page next week because that content is now **static**, unchanged from whenever you last published your page.\n\nThis is a case where we absolutely should write our content in JavaScript, so that it can be **dynamic**.\n\nNow with a template like this ...\n\n```ejs\n<p>Today's temperature is <span id=\"temp\"></span> degrees.</p>\n```\n\n... and a script like this ...\n\n```javascript\nconst apiData = await fetch('https://weather.com/api')\n                    .then(response => response.json());\n\ndocument.getElementById('temp').innerHTML = apiData.temp;\n```\n\n... our page will be updated with the most current data for readers.\n\n::: aside tip\n\n### Coda...\n\nThis section is simplified to help you think about how your content is being served to readers and where you might want to write it in our rig.\n\nThere are more advanced techniques to create content that can be both **pre-rendered/static** AND **dynamic**. See [Prerendering JS apps](../prerendering-js-apps/).\n\n:::\n\n## JS\n\nWhile the rig is very opinionated about what tools you use to build your HTML -- i.e., EJS -- it enforces almost no conventions on how you write your JavaScript.\n\nJavaScript moves fast, and this rig is designed to protect whatever way you want to write JS using whatever framework makes the most sense to you.\n\nThe only convention you need to respect is that your script has one entry file, `app.js`. That script is already included in the directoy:\n\n> - src/\n>   - js/\n>     - tools/\n>     - **app.js**\n\n(You can safely ignore scripts in the `tools/` directory, which include some scripts for page furniture like our share tools and others that are only used during development.)\n\nHere are some of the features included in the rig for writing JS:\n\n### Modern syntax and modules\n\nYou may write scripts using the [modern JavaScript syntax](https://www.taniarascia.com/es6-syntax-and-feature-overview/) and split them into independent modules that keep your code clean and easy to read.\n\n```javascript\n// js/app.js\nimport renderTitle from './renderTitle';\n\nconst title = 'My page title';\n\nrenderTitle(title);\n```\n\n```javascript\n// js/renderTitle.js\nconst renderTitle = (titleText) => {\n  document.getElementById('title-header').innerHTML = titleText;\n};\n\nexport default renderTitle;\n```\n\n### EJS templates in JS\n\nUse EJS templates in your scripts. Any template written **in the `js/` folder** (as opposed to the `html/` folder) can be imported and used as a dynamic template.\n\n> - js/\n>   - app.js\n>   - person.ejs\n\n```ejs\n<li><%= firstName %> <%= lastName %></li>\n```\n\n```javascript\nimport personTemplate from './person.ejs';\n\nconst somePeople = [ /* ... */];\n\nconst peopleList = somePeople.map(person => personTemplate({\n  firstName: person.firstName,\n  lastName: person.lastName,\n}));\n\n// [\n//   '<li>George Washington</li>',\n//   '<li>John Adams</li>',\n//   ...\n// ]\n\ndocument.getElementById('my-list').innerHTML = peopleList.join('');\n```\n\n### Translation with ttag\n\nYou can use [ttag.js](https://ttag.js.org/) to extract and translate text strings in your JavaScript. This is basically a more powerful equivalent of the `gt.gettext` helper in our EJS templates and will extract text to `messages.ttag.po` in the `locales` directory.\n\n\nSo with a script like this...\n\n```javascript\n// js/app.js\nconst greeting = t`Hello`;\n\ndocument.getElementById('greeting').innerHTML = greeting;\n```\n\n... translatable text will be extracted to `messages.ttag.po` like this ...\n\n```\nmsgid \"\"\nmsgstr \"\"\n\"Content-Type: text/plain; charset=utf-8\n\"\n\"Plural-Forms: nplurals = 2; plural = (n != 1);\n\"\n\"Language: en\n\"\n\"mime-version: 1.0\n\"\n\"Content-Transfer-Encoding: 8bit\n\"\n\n#: src/js/app.js:1\nmsgid \"Hello\"\nmsgstr \"\"\n```\n\n... which you can supply translations for like this in each locale ...\n\n```\n#: src/js/app.js:1\nmsgid \"Hello\"\nmsgstr \"Guten Tag\"\n```\n\nCheck out the [docs](https://ttag.js.org/docs/quickstart.html) for more information on using ttag.\n\nRead more about translation on the [Copy and translation](../copy-and-translation/) page.\n\n### Translation with markdown\n\nTo load different translations in your JavaScript files, you can use [dynamic expressions in an import statement](https://webpack.js.org/api/module-methods/#dynamic-expressions-in-import) and load locale-specific content.\n\n```javascript\nconst locale = document.documentElement.lang; // en, es, de, etc.\n\nimport(`Locales/${locale}/article/intro.md`).then((markdown) => {\n  document.getElementById('intro').innerHTML = markdown;\n});\n```\n\nBy default Webpack will create a separate code bundle for each markdown file you import in this way. It's probably a good idea to read more about the ways you can configure how those files are created by using Webpack's [\"magic comments.\"](https://webpack.js.org/api/module-methods/#magic-comments)\n\nRead more about using markdown files for translation on the [Copy and translation](../copy-and-translation/) page.\n\n### React\n\nSupport for [React](https://reactjs.org/) is built in. Simply write JSX in your JS files, directly.\n\n```javascript\n// js/app.js\nimport React from 'react';\nimport ReactDOM from 'react-dom';\n\nconst Title = () => <h1>My Title</h1>;\n\nReactDOM.render(document.getElementById('title-container'), <Title/>);\n```\n\n\n### Svelte\n\nSupport for [Svelte](https://svelte.dev/) is built in when using a `.svelte` extension.\n\n> - js\n>   - app.js\n>   - **title.svelte**\n\n```html\n\x3c!-- js/title.svelte --\x3e\n<script>\n  export let title;\n<\/script>\n\n<h1>{title}</h1>\n\n<style>\nh1{\n  color: red;\n}\n</style>\n```\n\n```javascript\n// js/app.js\nimport Title from './title.svelte';\n\nnew Title({\n  target: document.getElementById('title-container'),\n  props: {\n    title: 'My svelte page',\n  }\n});\n```\n\n## SCSS\n\nWrite your styles using [SCSS syntax](https://sass-lang.com/guide) in the `scss` directory.\n\nOnce you've written some styles, **make sure you import your root style sheets in JavaScript.**\n\n> - js/\n>   - app.js\n> - scss/\n>   - main.scss\n>   - _variables.scss\n\n```scss\n// main.scss\n@import 'variables';\n\nbody {\n  h1{\n    color: $red;\n  }\n}\n```\n\n```javascript\n// js/app.js\nimport '../main.scss';\n\n// ... or using our special scss directory alias ...\nimport 'SCSS/main.scss'\n```\n\n### SCSS modules\n\nFor advanced uses, you can also use SCSS with CSS module scoping by writing a SCSS file **in the `js/` directory**.\n\nFor example, files like these ...\n\n\n> - js/\n>   - app.js\n>   - **styles.scss**\n\n```scss\n.component :global {\n  h1 {\n    color: red;\n  }\n}\n```\n\n```javascript\nimport styles from './styles.scss';\n\ndocument.getElementById('my-red-container').classList.add(styles.component);\n```\n\n... will render a stylesheet and markup like this ...\n\n```scss\n._SOME123LONG456CLASS789NAME h1{\n  color: red;\n}\n```\n\n```html\n<div id=\"my-red-container\" class=\"_SOME123LONG456CLASS789NAME\">\n  <h1>My bloody title</h1>\n</div>\n```\n\nThis is probably most useful when writing JS components when using a framework like React. It lets you scope your styles locally to the component so you can avoid style collisions while writing very simple, easy to read style rules.\n",e.context||{})},e),null)}},function(e,t,n){"use strict";function o(t,e){var n,r=Object.keys(t);return Object.getOwnPropertySymbols&&(n=Object.getOwnPropertySymbols(t),e&&(n=n.filter(function(e){return Object.getOwnPropertyDescriptor(t,e).enumerable})),r.push.apply(r,n)),r}function r(r){for(var e=1;e<arguments.length;e++){var a=null!=arguments[e]?arguments[e]:{};e%2?o(Object(a),!0).forEach(function(e){var t,n;t=r,e=a[n=e],n in t?Object.defineProperty(t,n,{value:e,enumerable:!0,configurable:!0,writable:!0}):t[n]=e}):Object.getOwnPropertyDescriptors?Object.defineProperties(r,Object.getOwnPropertyDescriptors(a)):o(Object(a)).forEach(function(e){Object.defineProperty(r,e,Object.getOwnPropertyDescriptor(a,e))})}return r}var a=n(0),i=n(13),l=n(15);e.exports=function(e){return a.createElement(i,r({source:l.render("Translation is a first-class function of the rig. It's also very easy to create multiple versions of your page for each locale you want to publish in.\n\n## Contents\n\n- [Locales directory](#Locales-directory)\n- [Creating new locales](#Creating-new-locales)\n- [Writing locale content in markdown](#Writing-locale-content-in-markdown)\n  - [How it works](#How-it-works)\n  - [Special syntax](#Special-syntax)\n    - [Curly bracket attributes](#Curly-bracket-attributes)\n    - [Chunks](#Chunks)\n- [Extracting text](#Extracting-text)\n- [Previewing translated pages](#Previewing-translated-pages)\n\n## Locales directory\n\n**All** translatable content goes in the locales directory under a sub-folder named after an [ISO 639-1 two-letter language code](https://en.wikipedia.org/wiki/List_of_ISO_639-1_codes).\n\n> - locales/\n>   - **en/**\n>   - **es/**\n>   - **de/**\n\n**You must at least have an `en` locale directory.** (Included by default!)\n\nThe **folder name is critical** and used as a key throughout the rig to get content and indicate which locale is being built.\n\nBeyond the folder, your content files can be named whatever you like. That said, all translation tools in the rig -- including [localeMarkdown](../writing-code/#localeMarkdown), [localeData](../writing-code/#localeData), [gt.gettext](../writing-code/#gtgettext) and [ttags](../writing-code/#Translation-with-ttag) -- **expect all locale folders to contain the same files.** So be sure each locale folder is a mirror of the others.\n\n> - locales/\n>   - en/\n>     - **intro.md**\n>     - **messages.gettext.po**\n>     - **data.json**\n>   - de/\n>     - **intro.md**\n>     - **messages.gettext.po**\n>     - **data.json**\n\n## Creating new locales\n\nCreating a new locale is dead simple. Just add a new folder using the [ISO 639-1 code](https://en.wikipedia.org/wiki/List_of_ISO_639-1_codes) for your translation.\n\nAs a shortcut to scaffold your new locale, you can use the `add-locale` command to create a copy of all the translation files in your `en` locale:\n\n```bash\n$ runner add-locale\n```\n\nIf you *don't* use the command, you'll need to run the `extract-text` command to create `.po` files once you've created the directory and then be sure the new folder mirrors other locales.\n\n## Writing locale content in markdown\n\nGenerally, it's a good idea to write large chunks of text in markdown files.\n\nIf you're unfamiliar with markdown, check out [this cheatsheet](https://github.com/adam-p/markdown-here/wiki/Markdown-Cheatsheet) to get the idea or play around with an online editor like [stackedit](https://stackedit.io/app#).\n\n### How it works\n\nLet's say you have two translations of your intro copy in your locales folder like this:\n\n> - locales/\n>   - en/\n>     - **intro.md**\n>   - es/\n>     - **intro.md**\n\nIn your templates, you can use, for example, our `localeMarkdown` helper function to include the correct translation of that content in each page we build.\n\n```ejs\n::[3]\n\x3c!-- index.ejs --\x3e\n<body>\n  <%- localeMarkdown('intro.md') %>\n</body>\n```\n\nSo if your markdown files looked like this:\n\n```markdown\n# My English article\n\nHello world! ...\n```\n\n```markdown\n# Mi articulo en español\n\n¡Hola Mundo! ...\n```\n\n... they would render to a page for each locale like this:\n\n```html\n<body>\n  <h1>My English article</h1>\n  <p>Hello world! ...</p>\n</body>\n```\n\n```html\n<body>\n  <h1>Mi articulo en español</h1>\n  <p>¡Hola Mundo! ...</p>\n</body>\n```\n\n### Special syntax\n\nWe've extended the basic markdown syntax to add some additional helpers you may need.\n\n#### Curly bracket attributes\n\nYou can add attributes like classes and ids to elements within curly brackets like this:\n\n```markdown\n# header {#headline}\n\nMy paragraph ... {.small}\n```\n\n... which will render to HTML like this:\n\n```html\n<h1 id=\"headline\">header</h1>\n\n<p class=\"small\">My paragraph ...</p>\n```\n\nCombine curly bracket attributes with normal brackets to create spans around text.\n\n```markdown\nA paragraph with [a bit of red text]{.red} and back to normal.\n```\n\n```html\n<p>A paragraph with <span class=\"red\">a bit of red text</span> and back to normal.</p>\n```\n\nSee more in the docs for [markdown-it-attrs](https://www.npmjs.com/package/markdown-it-attrs).\n\n\n#### Chunks\n\nWhile you _can_ add HTML to markdown files, it's much better to **keep code out of markdown and in your EJS or JS scripts**.\n\nBut often you need to place text _around_ graphics. Instead of creating separate markdown files for each block of text, we've added a special syntax to help you split a single markdown file into **chunks** you can use to position text.\n\n\n> - locales/\n>   - en/\n>     - **article.md**\n\nSeparate and name different blocks in your markdown file like this:\n\n```markdown\n::[1,5,7,9]\n<< intro >>\n# My headline\n\nSome intro grafs...\n<<>>\n\n<< mySubhead >>\nLorem ipsum...\n<<>>\n```\n\nThen refer to each block individually using either localeMarkdown...\n\n```html\n<body>\n\n  <section id=\"intro\">\n    <%- localeMarkdown('artcle.md').intro %>\n  </section>\n\n  <section id=\"some-graphic\"> ... </section>\n\n  <%- localeMarkdown('article.md').mySubhed %>\n\n</body>\n```\n\n... or in JavaScript ...\n\n```javascript\nconst locale = document.documentElement.lang;\n\nimport(`Locales/${locale}/article.md`).then((markdown) => {\n  document.getElementById('intro').innerHTML = markdown.intro;\n});\n```\n\n\n## Extracting text\n\nIf you've used [gt.gettext](../writing-code/#gtgettext) in your templates or [ttags](../writing-code/#Translation-with-ttag) in your scripts to create translatable strings, use the `extract-text` command to automatically create `.po` files to use for translation.\n\n```\n$ runner extract-text\n```\n\nRunning the command multiple times to pick up new text is safe and won't erase translations you've already done. If _do_ you need to start from scratch, you can pass a `--reset` flag to the command.\n\n## Previewing translated pages\n\nFor now, the only way to preview translations is to build the English version of your page. Use the `$ runner preview` command to see the page built for your translation, for example at `http://localhost:8000/de/`.\n\n```\n$ runner preview\n```\n",e.context||{})},e),null)}},function(e,t,n){"use strict";function o(t,e){var n,r=Object.keys(t);return Object.getOwnPropertySymbols&&(n=Object.getOwnPropertySymbols(t),e&&(n=n.filter(function(e){return Object.getOwnPropertyDescriptor(t,e).enumerable})),r.push.apply(r,n)),r}function r(r){for(var e=1;e<arguments.length;e++){var a=null!=arguments[e]?arguments[e]:{};e%2?o(Object(a),!0).forEach(function(e){var t,n;t=r,e=a[n=e],n in t?Object.defineProperty(t,n,{value:e,enumerable:!0,configurable:!0,writable:!0}):t[n]=e}):Object.getOwnPropertyDescriptors?Object.defineProperties(r,Object.getOwnPropertyDescriptors(a)):o(Object(a)).forEach(function(e){Object.defineProperty(r,e,Object.getOwnPropertyDescriptor(a,e))})}return r}var a=n(0),i=n(13),l=n(15);e.exports=function(e){return a.createElement(i,r({source:l.render("For every page, the rig will also build an embeddable version designed to be used by clients directly in their CMS using [pym.js](http://blog.apps.npr.org/pym.js/).\n\n## Contents\n\n- [The embed template](#The-embed-template)\n- [Writing code for the embeddable page](#Writing-code-for-the-embeddable-page)\n- [Assets](#Assets)\n- [Watch out for viewport dimensions](#Watch-out-for-viewport-dimensions)\n- [Developing the embed page](#Developing-the-embed-page)\n\n## The embed template\n\nIn most cases, you want the embed page to look slightly different from the main page. For example, the embed page likely shouldn't have our header and footer. For this reason, there is a separate embed template in `src/html`:\n\n> - src/\n>   - html/\n>     - article.ejs\n>     - **index.ejs**\n>     - **embed.ejs**\n\n```ejs\n\x3c!-- index.ejs --\x3e\n<body>\n  <%- include('templates/nav'); %>\n\n  <%- include('article.ejs'); %>\n\n  <%- include('templates/footer'); %>\n</body>\n```\n\n```ejs\n\x3c!-- embed.ejs --\x3e\n<body>\n  <%- include('article.ejs'); %>\n</body>\n```\n\nNotice that `embed.ejs` **does not include** the header and footer templates.\n\nNotice, too, that both `index.ejs` and `embed.ejs` **do include** an article template, which would include the content both pages should share, like the body text and graphics.\n\nUsing EJS template includes, you can configure the two pages however you like for whatever content they share. See more in [Writing code](../writing-code/#Includes).\n\n## Writing code for the embeddable page\n\n#### JavaScript\n\nIf you need to write different code for the embed page than the interactive one, use this pattern:\n\n```javascript\nconst isEmbedded = window.location !== window.parent.location;\n\nif (isEmbedded) {\n  // This code will only run on the embeddable page.\n} else {\n  // This code will only run on the interactive page.\n}\n\n```\n\n#### SCSS\n\nIn the embeddable page, the body element receives a special class, which you can use in SCSS to scope styles just for that page.\n\n```scss\nbody.child-frame {\n  // These styles will only be applied to the embed page.\n}\n```\n\n## Assets\n\nEmbeddable pages share the same assets as the standard page by default.\n\n> - en/\n>   - index.html\n>   - embed.html\n>   - **app.123456789.js**\n>   - **app.123456789.css**\n>   - img/\n>     - **picture.jpg**\n\nThat means you generally don't need any special handling for assets like fonts or images in an embed page.\n\n## Watch out for viewport dimensions\n\nWatch out for CSS rules using viewport dimensions. `100vh` may mean something very different in the context of an iframe and can play havoc with pym.js's height calculation.\n\n\n## Developing the embed page\n\nThe development server (`runner start`) will also create a page to preview the embed page within an iframe at a set width. Use this preview to test how your page will look in someone else's CMS.\n\nAccess it at `https://localhost:{port}/framer.html` or using the link in the dev tool in the lower left corner of the preview page.\n",e.context||{})},e),null)}},function(e,t,n){"use strict";function o(t,e){var n,r=Object.keys(t);return Object.getOwnPropertySymbols&&(n=Object.getOwnPropertySymbols(t),e&&(n=n.filter(function(e){return Object.getOwnPropertyDescriptor(t,e).enumerable})),r.push.apply(r,n)),r}function r(r){for(var e=1;e<arguments.length;e++){var a=null!=arguments[e]?arguments[e]:{};e%2?o(Object(a),!0).forEach(function(e){var t,n;t=r,e=a[n=e],n in t?Object.defineProperty(t,n,{value:e,enumerable:!0,configurable:!0,writable:!0}):t[n]=e}):Object.getOwnPropertyDescriptors?Object.defineProperties(r,Object.getOwnPropertyDescriptors(a)):o(Object(a)).forEach(function(e){Object.defineProperty(r,e,Object.getOwnPropertyDescriptor(a,e))})}return r}var a=n(0),i=n(13),l=n(15);e.exports=function(e){return a.createElement(i,r({source:l.render("## Contents\n\n- [How do I add custom methods to D3.js?](#How-do-I-add-custom-methods-to-D3js?)\n- [How do I use Font Awesome?](#How-do-I-use-Font-Awesome?)\n\n## How do I add custom methods to D3.js?\n\nCreate a dedicated file in your project where you will add all your custom methods to d3.\n\n```js\n// my-d3.js\nimport * as d3 from 'd3';\n// so THIS way of importing gets you a READ ONLY copy of d3. so you can't directly write to it like you would a normal javascript object. it will work in dev but will just get overwritten and not work in the final build. we will deal with this at the end.\n\n// your custom function\nconst myCustomFunction = (params) => { ... };\n\n// now we create a new object and copy all the stuff from d3 to it, as well as our new function.\nexport default Object.assign(d3, {\n  myCustomFunction: myCustomFunction,\n});\n```\n\nAlternatively, you can add a _prototype_ to an existing d3 method _without_ creating a copy.:\n\n```js\n// my-d3.js\nimport * as d3 from 'd3';\n\nd3.selection.prototype.myCustomFunction = (params) => { ... };\n\n// this will work\nexport default d3;\n```\n\nNow you can use this d3 you just exported in other files like so:\n\n```js\n// another-file.js\nimport * as d3 from 'path/to/my-d3.js';\n\nd3.myCustomFunction(params);\n```\n\n\n\nYou can read more about why this works [here](https://exploringjs.com/es6/ch_modules.html#_in-es6-imports-are-live-read-only-views-on-exported-values).\n\n## How do I use Font Awesome?\n\nInstall fontawesome with yarn.\n\n```\n$ yarn add @fortawesome/fontawesome-free\n```\n\nWithin your `node_modules` folder, find `@fortawesome/fontawesome-free` and copy the `webfonts` folder into the `src/static` directory.\n\n> - src/\n>   - static/\n>     - **webfonts/**\n>       - fa-brands-400.eot\n>       - ...\n\nImport Font Awesome's SCSS stylesheets in `main.scss`.\n\n> - src/\n>   - scss/\n>     - **main.scss**\n\n```SCSS\n// Set the font-path variable FIRST\n$fa-font-path: 'webfonts';\n\n// Import the base SCSS stylesheet\n@import '~@fortawesome/fontawesome-free/scss/fontawesome.scss';\n\n// Import the fonts you need!\n@import '~@fortawesome/fontawesome-free/scss/solid.scss';\n@import '~@fortawesome/fontawesome-free/scss/regular.scss';\n```\n\nNow you can use Font Awesome's classes.\n\n```HTML\n<i class=\"fas fa-camera\"></i>\n```\n\nRead what other stylesheets you might want to include in [Font Awesome's SASS guide](https://fontawesome.com/how-to-use/on-the-web/using-with/sass).\n",e.context||{})},e),null)}},function(e,t,n){"use strict";function o(t,e){var n,r=Object.keys(t);return Object.getOwnPropertySymbols&&(n=Object.getOwnPropertySymbols(t),e&&(n=n.filter(function(e){return Object.getOwnPropertyDescriptor(t,e).enumerable})),r.push.apply(r,n)),r}function r(r){for(var e=1;e<arguments.length;e++){var a=null!=arguments[e]?arguments[e]:{};e%2?o(Object(a),!0).forEach(function(e){var t,n;t=r,e=a[n=e],n in t?Object.defineProperty(t,n,{value:e,enumerable:!0,configurable:!0,writable:!0}):t[n]=e}):Object.getOwnPropertyDescriptors?Object.defineProperties(r,Object.getOwnPropertyDescriptors(a)):o(Object(a)).forEach(function(e){Object.defineProperty(r,e,Object.getOwnPropertyDescriptor(a,e))})}return r}var a=n(0),i=n(13),l=n(15);e.exports=function(e){return a.createElement(i,r({source:l.render('\nYou can use Google sheets and docs to collaborate with others on translatable content and pull it into your project directly from Google Drive.\n\n## Contents\n\n- [Prerequisites](#Prerequisites)\n- [Where to put Google docs and sheets](#Where-to-put-Google-docs-and-sheets)\n- [Configuring Google APIs](#Configuring-Google-APIs)\n- [Downloading data from Google](#Downloading-data-from-Google)\n- [Using Docs](#Using-Docs)\n- [Using Sheets](#Using-Sheets)\n- [Using downloaded data in your code](#Using-downloaded-data-in-your-code)\n\n## Prerequisites\n\nIn order to use these features, you must have downloaded the Google API access file from the [Reuters Graphics 1Password account](https://reutersglobalgraphics.1password.com/) and placed it in your user directory at `~/.reuters-graphics/google-api.json`.\n\n## Where to put Google docs and sheets\n\nMake a sheet or doc in a folder within the **Reuters Graphics Interactive Docs** shared Google Drive folder. (Ask an editor if this hasn\'t already been shared with you.) This automatically gives our API scraper access to your doc. As long as your doc is in this folder, you can keep it private and share it directly with your collaborators.\n\nWe recommend you create a separate sheet or doc for each locale you want translated in a folder for your project.\n\n## Configuring Google APIs\n\nTo tell the rig what Google docs or sheets to use, you\'ll add configuration to a `google.json` file in the root of each locale folder.\n\n> - locales/\n>   - en/\n>     - **google.json**\n>   - es/\n>     - **google.json**\n\nWithin the config file, each **key** under `docs` or `sheets` is the path to the file you\'d like output. Each **value** is the ID of the doc or sheet you\'d like to download to that location.\n\n```js\n::[3,6]\n{\n  "docs": {\n    "myDoc.json": "XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX"\n  },\n  "sheets": {\n    "sheets/data.json": "XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX"\n  }\n}\n```\n\nFor example, keys like the above, will create files like this:\n\n> - locales/\n>   - en/\n>     - sheets/\n>       - **data.json**\n>     - google.json\n>     - **myDoc.json**\n>   - es/\n>     - sheets/\n>       - **data.json**\n>     - google.json\n>     - **myDoc.json**\n\nTo find the ID of you doc or sheet, look for a long string of random characters in the URL of the file in Google Drive. You can find it between `https://.../d/< DOC ID HERE >/edit`. For example:\n\nhttps://docs.google.com/spreadsheets/d/**1h1O8jPScxrUg-xmolKGSPzaePgyG3zbBkAWiijEpi0c**/edit\n\n## Downloading data from Google\n\n\nOnce you\'ve configured your Google docs `google.json`, you can download your content to JSON using:\n\n```\n$ runner get-google\n```\n\n## Using Docs\n\nGoogle docs are processed using [ArchieML](http://archieml.org/). Read more on their site about how you can use the syntax to structure your data.\n\n## Using Sheets\n\nYour spreadsheet can contain tabular data or key-value pairs. Read more in the [sheet-to-data docs](https://github.com/rdmurphy/sheet-to-data#structuring-your-spreadsheet) about how to structure your spreadsheet.\n\n\n## Using downloaded data in your code\n\n#### EJS\n\nAfter you\'ve downloaded your data from Google, you can use the `localeData` helper to pull your data into EJS files.\n\n```html\n<body>\n  <% const doc = localeData(\'myDoc.json\') %>\n\n  <h1><%= doc.title %></h1>\n\n  <% doc.paragraphs.forEach(function(paragraph){ %>\n  <p><%= paragraph %></p>\n  <% }); %>\n\n</body>\n```\n\n#### JS\n\nIn JS, you can use dynamic imports:\n\n```javascript\nconst locale = document.documentElement.lang; // en, es, de, etc.\n\nimport(`Locales/${locale}/myDoc.json`).then((doc) => {\n\n  const header = `<h1>${doc.title}</h1>`;\n\n  const paragraphs = doc.paragraphs.map(paragraph => `<p>${paragraph}</p>`);\n\n  // ...\n\n});\n```\n',e.context||{})},e),null)}},function(e,t,n){"use strict";function o(t,e){var n,r=Object.keys(t);return Object.getOwnPropertySymbols&&(n=Object.getOwnPropertySymbols(t),e&&(n=n.filter(function(e){return Object.getOwnPropertyDescriptor(t,e).enumerable})),r.push.apply(r,n)),r}function r(r){for(var e=1;e<arguments.length;e++){var a=null!=arguments[e]?arguments[e]:{};e%2?o(Object(a),!0).forEach(function(e){var t,n;t=r,e=a[n=e],n in t?Object.defineProperty(t,n,{value:e,enumerable:!0,configurable:!0,writable:!0}):t[n]=e}):Object.getOwnPropertyDescriptors?Object.defineProperties(r,Object.getOwnPropertyDescriptors(a)):o(Object(a)).forEach(function(e){Object.defineProperty(r,e,Object.getOwnPropertyDescriptor(a,e))})}return r}var a=n(0),i=n(13),l=n(15);e.exports=function(e){return a.createElement(i,r({source:l.render('Put media files (images, videos, etc.) and any other static assets (fonts, etc.) your page may need in the `static` directory.\n\n> - src/\n>    - html/\n>    - js/\n>    - scss/\n>    - **static/**\n\nPlease note: **Anything you put into this directory will be published with your page**, so keep large raw files or working drafts out of this folder. (Put that stuff in `project-files/`.)\n\n**WARNING:** The graphics server **may reject your project** if you put any non-standard web files in this directory. (Use `project-files/`!)\n\n\n## Contents\n\n- [Organizing media files](#Organizing-media-files)\n- [Referencing media files in your code](#Referencing-media-files-in-your-code)\n- [Share image](#Share-image)\n- [Responsive images](#Responsive-images)\n\n## Organizing media files\n\nYou should always make sub-folders in `src/static/` to organize your media files. For example:\n\n> - src/\n>    - static/\n>      - **img/**\n>        - picture.jpg\n>      - **data/**\n>         - people.json\n\n\n## Referencing media files in your code\n\nMedia files are always published alongside your index.html page for each locale.\n\nFor example, a directory with an image like this ...\n\n> - src/\n>   - html/\n>     - index.ejs\n>   - static/\n>     - img/\n>       - **picture.jpg**\n\n... will publish like this:\n\n\n> - index.html\n>   - img/\n>     - **picture.jpg**\n\nThat means you can use a relative path to the image in your code.\n\n```javascript\n<img src="./img/picture.jpg" alt="A picture" />\n```\n\nYou can use the same technique for media used in scripts and styles:\n\n> - static/\n>   - data/\n>     - **myData.json**\n>   - fonts/\n>     - **myFont.woff2**\n\n```javascript\nfetch(\'./data/myData.json\')\n  .then(response => response.json())\n  .then(data => { ... });\n```\n\n```scss\n@font-face {\n\tfont-family: MyFont;\n\tsrc: url(\'./fonts/myFont.woff2\') format(\'woff2\');\n}\n```\n\nIn general, you should **always use relative path references** to media. It makes our packages more portable for clients who may wish to publish our page on their own servers.\n\n## Share image\n\nThe one exception to the relative path rule is the share image, which must use an absolute path (i.e., with "https://...").\n\nWhile you should **still put your share image in the `static/img/` directory**, we want to render the absolute reference in `meta` tags.\n\nLuckily, the rig handles this exception for you! Read more on the [Metadata](../metadata) page.\n\n## Responsive images\n\nImages are often the largest parts of any page bundle, and frequently most of that data *is a waste*. A 2400px wide image can be expensive overkill for someone reading your page on a 425px wide device, downloading often **more than 10 times the data needed**.\n\nUsing [responsive images](https://developer.mozilla.org/en-US/docs/Learn/HTML/Multimedia_and_embedding/Responsive_images) helps make sure readers are only downloading what they need and, on photo-intensive projects, can dramatically decrease page load time.\n\nThe **srcset img tag** lets us specify a set of images at different widths and let the browser pick the one that\'s optimal for our reader\'s device. Read more about how it works [here](https://developer.mozilla.org/en-US/docs/Learn/HTML/Multimedia_and_embedding/Responsive_images#How_do_you_create_responsive_images).\n\nThe rig includes a command to quickly generate responsive sets of images (**.jpg only!**) and also outputs the finicky-to-write image tag you can use in your code. Here\'s how:\n\n\nPut an image at the largest resolution you want to support in your `static` directory.\n\n> - static/\n>   - img/\n>     - **bigPicture.jpg**\n\nNow to make a responsive image set, run the srcset command in the terminal:\n\n```\n$ runner make-srcset bigPicture.jpg\n```\n\nThe command will create images at a few standard widths, but you can specify your own:\n\n```\n$ runner make-srcset bigPicture.jpg -s 300 -s 600 -s 1200 -s 1500\n```\n\nThe command will create a new directory with your new images...\n\n> > - static/\n>   - img/\n>     - bigPicture.jpg\n>     - bigPicture/\n>       - **600.jpg**\n>       - **1200.jpg**\n>       - **2400.jpg**\n>       - **img.html**\n\n... and inside `img.html` is a prefab img tag with correct relative references to your new responsive images.\n\n```html\n<img srcset="img/bill/600.jpg 600w, img/bill/1200.jpg 1200w, img/bill/2400.jpg 2400w" src="img/bill/2400.jpg" alt="WRITE ME">\n```\n\nUse the tag directly in your code. You can safely delete the original image if you\'re happy with the responsive sized ones.\n',e.context||{})},e),null)}},function(e,t,n){"use strict";function o(t,e){var n,r=Object.keys(t);return Object.getOwnPropertySymbols&&(n=Object.getOwnPropertySymbols(t),e&&(n=n.filter(function(e){return Object.getOwnPropertyDescriptor(t,e).enumerable})),r.push.apply(r,n)),r}function r(r){for(var e=1;e<arguments.length;e++){var a=null!=arguments[e]?arguments[e]:{};e%2?o(Object(a),!0).forEach(function(e){var t,n;t=r,e=a[n=e],n in t?Object.defineProperty(t,n,{value:e,enumerable:!0,configurable:!0,writable:!0}):t[n]=e}):Object.getOwnPropertyDescriptors?Object.defineProperties(r,Object.getOwnPropertyDescriptors(a)):o(Object(a)).forEach(function(e){Object.defineProperty(r,e,Object.getOwnPropertyDescriptor(a,e))})}return r}var a=n(0),i=n(13),l=n(15);e.exports=function(e){return a.createElement(i,r({source:l.render('Metadata is incredibly important to making sure your page is discoverable and attracts a strong audience on social media. The rig ensures your page is filled out with necessary metadata before you publish and by default won\'t build your package unless you have the minimum metadata filled in.\n\n## Contents\n\n- [Where is the metadata?](#Where-is-the-metadata?)\n  - [Locale-specific metadata](#Locale-specific-metadata)\n  - [Project-wide metadata](#Project-wide-metadata)\n- [What\'s in the metadata?](#Whats-in-the-metadata?)\n  - [Locale metadata reference](#Locale-metadata-reference)\n  - [Package metadata reference](#Package-metadata-reference)\n- [How do I fill out metadata?](#How-do-I-fill-out-metadata?)\n\n## Where is the metadata?\n\nThe rig injects metatags automatically from JSON files when building your package.\n\nThe metadata files are located in two places:\n\n#### Locale-specific metadata\n\nTranslatable metadata is kept with all other locale-specific content in the `locales/` directory.\n\n> - locales/\n>   - en/\n>     - **metadata.json**\n>   - de/\n>     - **metadata.json**\n\n#### Package-wide metadata\n\nOther metadata that applies to all pages regardless of locale is kept in your project\'s `package.json` under a `reuters` key.\n\n> - bin/\n> - config/\n> - locales/\n> - src/\n> - **package.json**\n\n## What\'s in the metadata?\n\n#### Locale metadata reference\n\n```js\n{\n  // SLUGS used to build published page URLs\n  "slugs": {\n    "root": "HEALTH-CORONAVIRUS", // The main topic-related slug\n    "wild": "ITALY" // A more project-specific slug\n  },\n\n  // SEO title & description used for search results\n  "seoTitle": "Italy\'s coronavirus crisis: Maps, statistics and analysis",\n  "seoDescription": "Tracking the daily toll of the virus with the latest data",\n\n  // SHARE title & description used for social share cards\n  "shareTitle": "Italy\'s coronavirus crisis",\n  "shareDescription": "Tracking the daily toll of the virus",\n\n  // The share image\n  "image": {\n    "path": "img/share.jpg",\n    "width": 1200,\n    "height": 600\n  },\n\n  // Graphics server specific IDs and URLs for this locale\n  "editions": {\n    "media": {\n      "interactive": {\n        "id": "XXXXXXXX-XXXX-XXXX-XXXX-XXXXXXXXXXXX",\n        "url": "https://graphics.reuters.com/HEALTH-CORONAVIRUS-ITALY/XXXXXXXXXXX/"\n      },\n      "media-interactive": {\n        "id": "XXXXXXXX-XXXX-XXXX-XXXX-XXXXXXXXXXXX"\n      }\n    },\n    "public": {\n      "interactive": {\n        "id": "XXXXXXXX-XXXX-XXXX-XXXX-XXXXXXXXXXXX",\n        "url": "https://graphics.reuters.com/HEALTH-CORONAVIRUS-ITALY/XXXXXXXXXXX/"\n      }\n    }\n  }\n}\n```\n\nNote:  Not all of this metadata may be filled in during development.\n\n#### Package metadata reference\n\n```js\n{\n  // ...\n  // Metadata is in the "reuters" key in package.json\n  "reuters": {\n\n    // IDs for the card and board in Trello\n    "trello": {\n      "card": "XXXXXXXXXXXXXXXXXXXXXXXX",\n      "board": "XXXXXXXXXXXXXXXXXXXXXXXX"\n    },\n\n    // A URI used to publish previews to the testfiles bucket on AWS\n    "awsPreviewURI": "YYYY/XXXXXXXXXXXX",\n\n    // The desk the package is publishing from\n    "desk": "london",\n\n    // Publish date for the project\n    "publishDate": "2020-04-18T13:00:02.789Z",\n\n    // An array of package authors\n    "authors": [\n      {\n        "name": "Jon McClure",\n        "link": "https://www.twitter.com/JonRMcClure"\n      }\n    ],\n\n    // Referral links used to create referrals at the end of the page, up to 4\n    "referrals": [\n      "https://..."\n    ],\n\n    // The ID of the graphic package in the graphics server\n    "graphicId": "XXXXXXXX-XXXX-XXXX-XXXX-XXXXXXXXXXXX"\n  }\n}\n\n```\n\nNote:  Not all of this metadata may be filled in during development.\n\n## How do I fill out metadata?\n\nMost metadata is filled in automatically by the rig.\n\nWhen you build your page, the rig will prompt you for any metadata you have to supply, like the share and SEO titles and descriptions.\n\n```\n$ runner build\n```\n\nYou can add or edit metadata in their respective JSON files, BUT generally **you should not edit any of the IDs or URLs related to external platforms like the graphics server, Trello or AWS.**\n',e.context||{})},e),null)}},function(e,t,n){e.exports={component:"_2dUoZ7VINfR90VE775er63"}},function(e,t,n){"use strict";function o(t,e){var n,r=Object.keys(t);return Object.getOwnPropertySymbols&&(n=Object.getOwnPropertySymbols(t),e&&(n=n.filter(function(e){return Object.getOwnPropertyDescriptor(t,e).enumerable})),r.push.apply(r,n)),r}function r(r){for(var e=1;e<arguments.length;e++){var a=null!=arguments[e]?arguments[e]:{};e%2?o(Object(a),!0).forEach(function(e){var t,n;t=r,e=a[n=e],n in t?Object.defineProperty(t,n,{value:e,enumerable:!0,configurable:!0,writable:!0}):t[n]=e}):Object.getOwnPropertyDescriptors?Object.defineProperties(r,Object.getOwnPropertyDescriptors(a)):o(Object(a)).forEach(function(e){Object.defineProperty(r,e,Object.getOwnPropertyDescriptor(a,e))})}return r}var a=n(0),i=n(13),l=n(15);e.exports=function(e){return a.createElement(i,r({source:l.render("\n\"Prerendering\" is the concept of rendering and injecting JavaScript-generated content into the static HTML of your page before publishing it to the web.\n\nPrerendering a JS app makes your page significantly faster to load for a reader and lets bots and crawlers see your content, which improves your page's SEO. In some cases, it may even let you skip JavaScript altogether, making your page much lighter weight.\n\nThe graphics rig comes with tools to let you build and prerender JavaScript applications using modern frameworks like [React](https://reactjs.org/), with templating engines like [EJS](https://ejs.co/), or using plain ES6 JavaScript syntax like [template strings](https://wesbos.com/template-strings-html/).\n\n## Contents\n\n- [Quickstart](#Quickstart)\n  - [Step 1: HTML](#Step-1-HTML)\n  - [Step 2: JS](#Step-2-JS)\n    - [EJS example](#EJS-example)\n    - [React example](#React-example)\n  - [Step 3: Register your app](#Step-3-Register-your-app)\n    - [Static-only apps](#Static-only-apps)\n- [Advanced techniques](#Advanced-techniques)\n  - [Using local data](#Using-local-data)\n  - [Using remote data (async)](#Using-remote-data-async)\n  - [Multiple EJS templates](#Multiple-EJS-templates)\n  - [Static shells](#Static-shells)\n  - [More configuration](#More-configuration)\n\n## Quickstart\n\n### Step 1: HTML\n\nMake a container element in your HTML and be sure it has a unique ID. The rig will use this placeholder to inject your prerendered JS content into the page. Remember, anything inside this container will be replaced by your JS content, so it's generally best to make it an empty div.\n\n```html\n\x3c!-- article.ejs --\x3e\n\n<div id=\"app-root\"></div>\n```\n\n### Step 2: JS\n\nMake a new JavaScript file that will be the entry point for your application. Your new script should export a default function, which **must return a string of HTML when run.**\n\nHere's an example using template strings:\n\n```javascript\n// myApp.js\n\nconst somePeople = ['Ada Lovelace', 'Grace Hopper', 'Edith Clarke'];\n\nconst makeRow = (name) => `<li>${name}</li>`;\nconst makeList = (names) => `<ul>${names.map(makeRow).join('')}</ul>`;\nconst makeHTML = () => makeList(somePeople);\n\n\n// This function is what the rig will call to render your content!\nexport default () => {\n  return makeHTML();\n}\n```\n\nTo make sure your script also works in the browser during development, you should also write code to inject the content into your page.\n\n```javascript\n::[10]\n// myApp.js\n\nconst somePeople = ['Ada Lovelace', 'Grace Hopper', 'Edith Clarke'];\n\nconst makeRow = (name) => `<li>${name}</li>`;\nconst makeList = (names) => `<ul>${names.map(makeRow).join('')}</ul>`;\nconst makeHTML = () => makeList(somePeople);\n\n// This will render your content into #app-root in the browser!\ndocument.getElementById('app-root').innerHTML = makeHTML();\n\nexport default () => {\n  return makeHTML();\n}\n```\n\nTo save a step when your code is run, you can also conditionally render in the browser only if your container hasn't already been filled with your content.\n\n```javascript\n::[9-14]\n// myApp.js\n\nconst somePeople = ['Ada Lovelace', 'Grace Hopper', 'Edith Clarke'];\n\nconst makeRow = (name) => `<li>${name}</li>`;\nconst makeList = (names) => `<ul>${names.map(makeRow).join('')}</ul>`;\nconst makeHTML = () => makeList(somePeople);\n\nconst APP_ROOT = document.getElementById('app-root');\n\n// If container is empty, then we inject the content ourselves.\nif (!APP_ROOT.hasChildNodes()) {\n  APP_ROOT.innerHTML = makeHTML();\n}\n\nexport default () => {\n  return makeHTML();\n}\n```\n\nHere are a few more examples of similar apps using EJS and React:\n\n#### EJS example\n\n```javascript\n// myApp.js\nimport myTemplate from './myTemplate.ejs';\n\nconst APP_ROOT = document.getElementById('app-root');\n\nif (!APP_ROOT.hasChildNodes()) {\n  APP_ROOT.innerHTML = myTemplate({ /* ... */ });\n}\n\nexport default () => {\n  return myTemplate({ /* ... */ });\n}\n```\n\n#### React example\n\n```javascript\n// myApp.js\nimport React from 'react';\nimport ReactDOM from 'react-dom';\nimport { renderToString } from 'react-dom/server';\nimport MyComponent from './myComponent';\n\nconst APP_ROOT = document.getElementById('app-root');\n\nif (APP_ROOT.hasChildNodes()) {\n  ReactDOM.hydrate(<MyComponent />, APP_ROOT);\n} else {\n  ReactDOM.render(<MyComponent />, APP_ROOT);\n}\n\nexport default () => {\n  return renderToString(<MyComponent />);\n}\n```\n\n### Step 3: Register your app\n\nLastly, you need to register your app for prerendering.\n\nCreate a file at `src/js/prerenderApps.js` and add a configuration object to the array like this:\n\n```javascript\n// src/js/prerenderApps.js\nmodule.exports = [\n  {\n    script: 'myApp.js',\n    selector: '#app-root',\n  },\n];\n```\n\n`script` is the path to your app script, relative to the `src/js/` directory.\n\n`selector` is the query selector for the container div in your HTML.\n\n#### Static-only apps\n\nIf your JS content will never change in response to any reader interactions -- i.e., is [**static**](/style/graphics-rig/writing-code/#Server-vs-client-static-vs-dynamic) -- then there's not really a reason for you to render your JavaScript app a second time when the user loads the page.\n\nIn this case you can tell the rig to exclude your app's script from the page after it renders and injects the JS content. Just set `staticOnly` to `true` on your configuration object.\n\n```javascript\n::[6]\n// src/js/prerenderApps.js\nmodule.exports = [\n  {\n    script: 'myApp.js',\n    selector: '#app-root',\n    staticOnly: true,\n  },\n];\n```\n\nTo give you an idea what this does, here's your HTML *without* `staticOnly` set:\n\n```html\n::[7]\n<html>\n<body>\n\n<div id='app-root'>\x3c!-- Your app's rendered content here --\x3e</div>\n\n\x3c!-- Your app's script included on the page, which has to be loaded and run again... --\x3e\n<script src='myApp.js'><\/script>\n\n</body>\n</html>\n```\n\n... and here's your HTML *with* `staticOnly` set:\n\n```html\n::[7]\n<html>\n<body>\n\n<div id='app-root'>\x3c!-- Your app's rendered content here --\x3e</div>\n\n\x3c!-- Your app's script excluded from the page, which makes it faster! --\x3e\n\n\n</body>\n</html>\n```\n\nRemember, you should only use this feature if your content is truly static. For dynamic content -- essentially if your app needs **ANY** JavaScript to run as the reader goes through your page -- then you'll have to keep you prerendered app dynamic.\n\n## Advanced techniques\n\nPrerendering JS content is a very powerful feature that in many cases is completely approachable using the graphics rig. There are, however, lots of caveats in more complex cases.\n\n### Using local data\n\nIf you need to include some local data in your app, it's better to put your JSON in the JS folder near your app and directly import it into your script.\n\n> - src/\n>   - js/\n>     - myApp.js\n>     - **myData.json**\n\n\n```javascript\n// myApp.js\nimport myData from './myData.json';\nimport myTemplate from 'myTemplate.ejs';\n\nexport default () => {\n  return myTemplate({ data: myData });\n}\n```\n\n### Using remote data (async)\n\nIf you need to get some data from a remote source, like an API or an already published JSON file, make your app's default export function asynchronous and use `fetch`:\n\n```javascript\n// myApp.js\nimport myTemplate from 'myTemplate.ejs';\n\nexport default async() => {\n  const response = await fetch('https://myAPI.com/');\n  const myData = await response.json();\n  return myTemplate({ data: myData });\n}\n```\n\n### Multiple EJS templates\n\nWhen using multiple EJS templates, remember that your app's default export function must return *a single string of HTML.*\n\nIf multiple templates are creating different parts of your content, you can use template strings to combine them into a single string:\n\n```javascript\n// myApp.js\nimport myChart from 'chartTemplate.ejs';\nimport myTable from 'tableTemplate.ejs';\n\nconst appContent = () => {\n  return `<div class='app-container'>\n    <div class='chart-container'>${myChart({ /* ... */})}</div>\n    <div class='table-container'>${myTable({ /* ... */})}</div>\n  </div>`;\n};\n\nconst APP_ROOT = document.getElementById('app-root');\n\nif (!APP_ROOT.hasChildNodes()) APP_ROOT.innerHTML = appContent();\n\nexport default () => {\n  return appContent();\n}\n```\n\n### Static shells\n\nOne common pattern is to create a \"shell\" of the static elements of your page you know won't change in response to reader interactions, then hook interactive content into that shell.\n\nHere's a simple example of how to do it in the rig:\n\nFirst, we write a prerendered app to create our \"shell\" elements...\n\n```javascript\n// src/js/myApp.js\nconst makeHTML = () => `\n  <div id='map-container'></div>\n  <div id='chart-container'></div>\n`;\n\nconst ROOT = document.getElementById('app-root');\nif (!ROOT.hasChildNodes()) ROOT.innerHTML = makeHTML();\n\nexport default () => {\n  return makeHTML();\n}\n```\n\n... next, register that prerendered app as a `staticOnly` application ...\n\n```javascript\n// src/js/prerenderApps.js\nmodule.exports = [\n  {\n    script: 'myApp.js',\n    selector: '#app-root',\n    staticOnly: true,\n  },\n];\n```\n\n... lastly, in our main script, we can hook into the shell elements ...\n\n```javascript\n// src/js/app.js\nimport Map from './myMap.js';\nimport Chart from './myChart.js';\n\nconst map = new Map({\n  container: document.getElementById('map-container'),\n});\nmap.draw();\n\nconst chart = new Chart({\n  container: document.getElementById('chart-container'),\n});\nchart.draw();\n```\n\n**Important caveats:** If your prerendered app is async, this pattern won't work in development, where the main script will likely fire before the shell is rendered. It's also generally not a good idea to write prerendered apps that depend on elements created by other prerendered apps. Execution order between prerendered apps can't be guaranteed.\n\n### More configuration\n\nThe rig uses our own webpack plugin, [html-webpack-prerender-plugin](https://github.com/reuters-graphics/html-webpack-prerender-plugin), to prerender JS apps. You can pass additional configuration to the plugin through the `pluginOptions` key.\n\n```javascript\n::[5-9]\nmodule.exports = [\n  {\n    script: 'myApp.js',\n    selector: '#app-root',\n    pluginOptions: {\n      scope: {},\n      props: {},\n      injectPropsTo: '',\n    }\n  },\n]\n```\n\nRead more in the plugin's [configuration docs](https://github.com/reuters-graphics/html-webpack-prerender-plugin/blob/master/docs/options.md) and [examples](https://github.com/reuters-graphics/html-webpack-prerender-plugin#next).\n",e.context||{})},e),null)}},function(e,t,n){"use strict";function o(t,e){var n,r=Object.keys(t);return Object.getOwnPropertySymbols&&(n=Object.getOwnPropertySymbols(t),e&&(n=n.filter(function(e){return Object.getOwnPropertyDescriptor(t,e).enumerable})),r.push.apply(r,n)),r}function r(r){for(var e=1;e<arguments.length;e++){var a=null!=arguments[e]?arguments[e]:{};e%2?o(Object(a),!0).forEach(function(e){var t,n;t=r,e=a[n=e],n in t?Object.defineProperty(t,n,{value:e,enumerable:!0,configurable:!0,writable:!0}):t[n]=e}):Object.getOwnPropertyDescriptors?Object.defineProperties(r,Object.getOwnPropertyDescriptors(a)):o(Object(a)).forEach(function(e){Object.defineProperty(r,e,Object.getOwnPropertyDescriptor(a,e))})}return r}var a=n(0),i=n(13),l=n(15);e.exports=function(e){return a.createElement(i,r({source:l.render('The Graphics Rig is the primary tool for building interactive and graphic pages at Reuters Graphics.\n\n## Prerequisites\n\nThe rig requires **Node version 12.0 - 13.9** (use [nvm](https://github.com/nvm-sh/nvm) if you need to manage multiple versions of Node...) and [the Yarn package manager](https://legacy.yarnpkg.com/en/docs/install).\n\nYou also must have a **GitHub [personal access token](https://help.github.com/en/github/authenticating-to-github/creating-a-personal-access-token-for-the-command-line)** with "repo" permissions and single sign-on enabled to access the ["tr" GitHub org](https://github.com/tr). That token must be saved [to your OSX Keychain](https://help.github.com/en/github/using-git/updating-credentials-from-the-osx-keychain).\n\n\n\n## Starting a project\n\n::: aside tip\n\n### If this is your first time...\n\n... you\'ll need to run through a couple additional setup steps.\n\n\n\n#### Dependencies\n\n**First,** install our task [runner](https://github.com/reuters-graphics/runner) and our scaffolding engine, [bluprint](https://github.com/reuters-graphics/bluprint), **globally**.\n\n```bash\n$ yarn global add @reuters-graphics/runner\n$ yarn global add @reuters-graphics/bluprint\n```\n\n**Second,** create a GitHub [personal access token](https://help.github.com/en/github/authenticating-to-github/creating-a-personal-access-token-for-the-command-line) (preferably a _different token_ to the one you use to access tr GitHub so it won\'t expire) and register the token with bluprint\'s CLI:\n\n  ```bash\n  $ bluprint token <your github token>\n  ```\n\n\n**Now,** add the graphics rig bluprint to bluprint\'s CLI:\n\n  ```bash\n  $ bluprint add reuters-graphics/bluprint_graphics-rig\n  ```\n\n#### Passwords and keys\n\nWhen you first use the graphics rig bluprint, you\'ll be asked several questions that will be used to create a profile on your machine with information about your byline as well as some credentials you\'ll need to publish your work.\n\nMake sure you have the following credentials on hand to answer those prompts:\n\n- **username** (your employee ID number) & **password** to publish to the graphics server\n- AWS **access key** & **secret access key** with rights to publish to the graphics AWS S3 bucket\n- A **key** & **token** to access the Trello API.\n\nIf you don\'t have graphics server credentials, reach out to an editor to get them for you. AWS & Trello credentials are kept in the [Global Graphics 1Password account](https://reutersglobalgraphics.1password.com/) (look for passwords with the "Graphics rig" tag).\n\n#### Watch a walk-through video\n\n(The password is: "graphics")\n\n<iframe src="https://player.vimeo.com/video/409931962" width="100%" height="400px" frameborder="0" allow="autoplay; fullscreen" allowfullscreen></iframe>\n\n:::\n\n\nMake a fresh directory for your new project and use the `graphics rig` bluprint to scaffold out your project.\n\n  ```\n  $ mkdir my-new-project\n  $ cd my-new-project\n  $ bluprint start\n  ```\n\n\n## What\'s in it?\n\n> - bin/\n> - config/\n> - **locales/**\n> - project-files/\n> - **src/**\n> - package.json\n\n- `bin/`: Admin scripts that do one-off tasks like resize images and check metadata files.\n- `config/`: Admin scripts that configure the page builder. (Mostly [webpack](https://webpack.js.org/).)\n- `locales/`: 👈 **Write your content here!**  Folders for each locale. See [Copy and translation](../copy-and-translation/).\n- `project-files/`: Any arbitrary files you want to keep with your project but not publish, e.g., ai files.\n- `src/`: 👈 **Write your code here!** See [Writing Code](../writing-code/).\n- `package.json`: Contains metadata about the project.\n\nRead more in this guide.\n\n\n## Basic commands\n\n### Developing\n\nThe bluprint will install dependencies for you and automatically start a development server. To restart the dev server, use the runner:\n\n```\n$ runner start\n```\n\n\n### Previewing locally\n\nTo preview what your pages will look like after they\'ve been compiled and minified, run the `preview` command which will start a local server. This will show you exactly what your page will look like to your readers.\n\n  ```\n  $ runner preview\n  ```\n\nYou can change the locale at the end of the URL to see other translations.\n\n  ```\n  https://localhost:8000/en/\n  ```\n\n### Sharing previews\n\nBoth the `start` and `preview` commands take an optional `--ngrok` argument that will create a secure (**but public!**) URL you can share with others or use to test your page on a mobile phone. Read more about [ngrok](https://ngrok.com/) on their website.\n\n```\n$ runner start --ngrok\n```\n\n```\n$ runner preview --ngrok\n```\n\nYou can also publish your project to a testfiles directory on AWS.\n\n```\n$ runner preview:aws\n```\n\n### Publishing\n\nProjects are published through our [Reuters graphics server](https://sphinx.thomsonreuters.com/graphics/?#/group/rngs). Publishing requires **two** steps.\n\nFirst, upload your project files to the server:\n\n```\n$ runner upload\n```\n\nThe "upload" command will check your metadata files to make sure you have all the information you need on the page, will build out your project files and finally create the graphics pack and individual editions of your project on the server.\n\nOptionally, you can upload a single locale to the server by passing the locale code to the command:\n\n```\n$ runner upload de\n```\n\nAfter you\'ve pushed all your code to the server, you can **publish** all your editions with:\n\n```\n$ runner publish\n```\n\nAnytime you upload any updates to your project, you must republish the entire package.\n',e.context||{})},e),null)}},function(e,t,n){e.exports={component:"_3bRRMfx17kYlJt0s_tB0A8"}},function(e,t,n){e.exports={component:"_2Wbcd5CZKWhjQEP_6uql6I"}},function(e,t,n){e.exports={component:"HpNEmkmnb-neho-dTNXK"}},function(e,t,n){n(215),n(402),e.exports=n(544)},function(e,t,n){"use strict";n(216);var r,a=(r=n(389))&&r.__esModule?r:{default:r};a.default._babelPolyfill&&"undefined"!=typeof console&&console.warn&&console.warn("@babel/polyfill is loaded more than once on this page. This is probably not desirable/intended and may have consequences if different versions of the polyfills are applied sequentially. If you do need to load the p